import { getAllUser } from "@apis/analysis";
import Button from "@components/button";
import Header from "@layoutStore/header";
import Navbar from "@layoutStore/navbar";
import { useEffect } from "react";

const CustomerPage = () => {

  useEffect(() => {
    const fetchData = async () => {
      try {
        const result = await getAllUser();
        console.log(result)
      } catch (error) {
        throw Error("Failed to fetch data");
      } 
    };
  }, []);
  return (
    <>
      <div className="w-[100vw] h-[100vh] relative">
        <Header></Header>
        <Navbar></Navbar>
        <div className="top-[20%] left-[18%] absolute">
          <div className="w-full h-full list-users flex gap-x-52 translate-x-[350px]">
            <Button title="All Users"></Button>
            <Button title="Sellers"></Button>
            <Button title="Customers"></Button>
          </div>
        </div>
        <div className="w-[80%] mt-[14%] absolute">
          <div className=" ">
            <div className="bg-transparent w-[80%] translate-x-[38%] px-7 py-3 border border-gray-700 rounded-full shadow-2xl flex justify-around mb-5">
              <div>ID</div>
              <div>Username</div>
              <div>Email</div>
              <div>Gender</div>
              <div>Birthday</div>
              <div>FirstName</div>
              <div>LastName</div>
              <div>Phone</div>
              <div>Address</div>
              <div>Role</div>
            </div>
            <div className="w-[80%] translate-x-[38%] flex justify-around px-7 py-3 border border-gray-700">
              <div>ID</div>
              <div>Username</div>
              <div>Email</div>
              <div>Gender</div>
              <div>Birthday</div>
              <div>FirstName</div>
              <div>LastName</div>
              <div>Phone</div>
              <div>Address</div>
              <div>Role</div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default CustomerPage;
